body:
### Describe the issue

I cannot successfully run the code below after compiling with rocm support.

```c++

// main.cpp
#include <assert.h>
#include <onnxruntime_cxx_api.h>

#include <iostream>
#include <vector>

void run() {
  Ort::Env env(ORT_LOGGING_LEVEL_WARNING, "test");
  const auto& api = Ort::GetApi();
  Ort::SessionOptions session_options;
  session_options.SetIntraOpNumThreads(1);
  session_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_EXTENDED);

  OrtROCMProviderOptions rocm_options;

  Ort::ThrowOnError(api.SessionOptionsAppendExecutionProvider_ROCM(session_options, &rocm_options));
  std::cout << "Running ORT ROCM EP with default provider options" << std::endl;
}

int main(int /*argc*/, char*[]) {
  run();
  return 0;
}
```

with command:
```cmd
g++ main.cpp -I/code/onnxruntime/include/onnxruntime/core/session -lonnxruntime
```

I have searched the issues and some of them told me that I need to have `libonnxruntime.so` in my LD_LIBRARY_PATH. But I cannot find any `libonnxruntime.so` under the `build/Linux/RelWithDebugInfo` folder.

How can I solve the problem?

### Urgency

I cannot run any code using rocm through c++ API. I think it is very urgent for me.

### Target platform

rocm,migraphx

### Build script

I have following the instructions in the dockerfile.rocm.
The build script is:
```cmd
./build.sh --config RelWithDebInfo --build_wheel --update --build --parallel --cmake_extra_defines ONNXRUNTIME_VERSION=$(cat ./VERSION_NUMBER) --use_rocm --rocm_home=/opt/rocm
```

Using rocm 5.2.3

### Error / output

/usr/bin/ld: cannot find -lonnxruntime

